              _scale_gradient.className = "scale-gradient";
              _scale_gradient.style.width = width + 'px';

              var minVal = Math.round(gradient[0].value);
              var maxVal = Math.round(gradient[gradient.length - 1].value);
              var section = Math.round((maxVal - minVal) / 4);
              var _scale_dividers = document.createElement('div');
